import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";
function Expenses(props) {
  return (
    <div>
      <ExpenseItem
        date={props.expenses[0].date}
        amount={props.expenses[0].amount}
        title={props.expenses[0].amount}
      ></ExpenseItem>
      <ExpenseItem
        date={props.expenses[1].date}
        amount={props.expenses[1].amount}
        title={props.expenses[0].amount}
      ></ExpenseItem>
      <ExpenseItem
        date={props.date}
        amount={props.amount}
        title={props.amount}
      ></ExpenseItem>
      <ExpenseItem
        date={props.date}
        amount={props.amount}
        title={props.amount}
      ></ExpenseItem>
    </div>
  );
}

export default Expenses;
